import React, { useState } from "react";

const Login = () => {
  return (
    <div class="bg-principal-color h-screen flex items-center justify-center">
      <div class="h-80 w-80">
        <img src="https://wallha.com/download/ws/13/fotYTdx4-wallha.com.jpg" alt="" />
      </div>
      <div class="h-80 w-80 bg-white flex items-center justify-center flex flex-col items-center space-y-4">
        <p class="text-sm">ProVision</p>
        <p class="text-3xl font-serif">Bienvenido de Nuevo</p>
        <img className="h-14 w-14 rounded-full border-b-2 border-black" src="https://thumbs.dreamstime.com/b/l%C3%ADnea-icono-del-negro-avatar-perfil-de-usuario-121102131.jpg" alt="User Avatar"/>

        <div class="flex flex-col space-y-2">
          <p class="text-xs font-bold">USER</p>
            <input type="text" class="border-b-2 border-black"/>
            <p class="text-xs font-bold">PASSWORD</p>
          <input type="text" class="border-b-2 border-black"/>
        </div>
      </div>

    </div>
  );
};

export default Login;
